import { Link } from "react-router-dom";
import { Card, CardContent, Typography } from "@mui/material";
import '../Styles/weatherBackCard.css';

const weatherBackCard = ({ weather, cityInfo }) => {
  const sunrise = new Date((cityInfo.sunrise) * 1000).toDateString()
  const sunset = new Date((cityInfo.sunset) * 1000).toDateString()
  return (
    <div className="BackCard">
      <Card sx={{ minWidth: 275 }}>
        <CardContent>
          <ul className="Sun">
            <li><Typography>Sunrise: {sunrise}</Typography></li>
          </ul>
          <ul className="Temps">
            <li><Typography>Min: {weather.main.temp_min}</Typography></li>
            <li><Typography>Max: {weather.main.temp_max}</Typography></li>
          </ul>
          <Typography>Humidity: {weather.main.humidity}%</Typography>
          <Link to="/">Back</Link>
        </CardContent>
      </Card>
    </div>
  );
};

export default weatherBackCard;
